import './App.css';
import Navbar from './Components/Navbar/navbar';
import Hero from './Components/Hero/hero';
import Content from './Components/Content/content';

function App() {
  return (
    <div className="container"> {/* Ensure this uses the App class */}
      <Navbar />
      <Hero />
      <Content />
    </div>
  );
}

export default App;
